import React from 'react';
import AppLayout from '../components/AppLayout';
import Head from 'next/head';

const Home = () => {
  {/* <AppLayout>으로 감싸진 애들이 children이 된다. */}

  return (
    <>
      <Head>
        <title>노드버드</title>
      </Head>
      <AppLayout><div>Hello, Next!</div></AppLayout>
    </>
  );
}

export default Home;
